<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>GranaDy random block generator</title>
    <link rel="icon" type="image/x-icon" href="images/icon.webp">

    <style>
        .outer {
            width: 100%;
            text-align: center;
        }

        .inner {
            display: inline-block;
        }

        h1 {
            font-family: Arial;
        }

        body {
            margin: 0;
        }
    </style>
</head>
<body class="outer">

<div class="inner">

    <h1>Trackmania Random Block Generator</h1>
    <button onclick="selectRandom()">Random block</button>
    <br>

    <span id="counter" style="font-size: 10px; color: gray; font-family: Arial"></span>
    <br>
    <span id="path" style="font-size: 50px; font-family: Arial"></span><br>

    <img id="icon" src="images/icon.webp" onerror="this.src = getAltImage()"><br>
    <h3>Filters (Inclusive)</h3>
    <div>
        <input type="checkbox" name="Filter" id="ice_block" filter="Ice" checked>Ice Blocks
        <input type="checkbox" name="Filter" id="road_block" filter="Road" checked>Road Blocks
        <input type="checkbox" name="Filter" id="dirt_block" filter="Dirt" checked>Dirt Blocks
        <input type="checkbox" name="Filter" id="plastic_block" filter="Plastic" checked>Plastic Blocks
        <input type="checkbox" name="Filter" id="grass_block" filter="Grass" checked>Grass Blocks<br>
        <input type="checkbox" name="Filter" id="sausage_block" filter="Bump" checked>Sausage Blocks
        <input type="checkbox" name="Filter" id="water_block" filter="Water" checked>Water Blocks<br>
    </div>
</div>


<script>

    var amount = 0;


    function isBlockValid(block) {
        var isIncluded = false;
        const filters = document.querySelectorAll("input[name=Filter]");
        filters.forEach((filter) => {
            if(filter.checked)
            {   
                if(block.includes(filter.getAttribute('filter'))) {
                    isIncluded = true;
                }
            }
        });
        return isIncluded;
    }
    function selectRandom() {
        amount++;

        let block = '';
        do
        {
            block = paths[Math.floor(Math.random() * paths.length)];
        }
        while(!isBlockValid(block));        
        let parts = block.split(" ");

        document.getElementById("path").innerText = parts[0];
        document.getElementById("counter").innerText = "Counter: " + amount + " " + (amount === 1 ? "block" : "blocks") + " generated";

        document.getElementById("icon").src = "images/" + parts[1] + ".png";

        /*if (amount === 25) {
            active = true;
            document.getElementById("path").innerText = parts[0]+"\nHappy Birthday Nico!";

            var audio = new Audio('images/sound.mp3');
            audio.play();
            setTimeout(function () {
                audio.pause();
                active = false;
            }, 10000)
        }*/
    }
